import React, { useState } from 'react';
import './Expenses.css'
import ExpenseItem from './ExpenseItem'
import Card from './UI/Card'
import ExpenseFilter from './ExpenseFilter'


const Expenses = (props) => {

  const [chosenYear, setChosenYear] = useState('2022');


  const filterChangeHandler = enteredYear => {
    setChosenYear(enteredYear);
}

  return (


    <Card className="expenses">
      <ExpenseFilter selectedYear={chosenYear} onChangeFilter={filterChangeHandler} />

      {props.items.map((expenses) => <ExpenseItem
        title={expenses.title}
        amount={expenses.amount}
        date={expenses.date} />)}

      </Card>
  )
}



export default Expenses;
